import React, {useState, useEffect} from 'react'
import './App.css';
import Heading from './Reference JS/Header';
import BodyComponent from './Reference JS/Body';

function App() {

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("https://localhost:3000/members").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])



  return (
    <div className="App">
      <Heading />
      <BodyComponent />
    </div>
  );
}

export default App;
